import { StyleSheet } from 'react-native';

const styles = StyleSheet.create({
    container : {
        flex: 1,
        backgroundColor: '#8257E5',
        justifyContent: 'center',
        padding: 40,
    },

    bunner: {
        width: '100%',
        resizeMode: 'c'
    }
});

export default styles;
